const Gallery = () => {
  return (
    <div className="pt-20" style={{ backgroundColor: '#F6F5F5' }}>
      <div className="mx-auto px-6 md:px-20 xxl:px-0" style={{ maxWidth: '1550px' }}>
        <h3 className="text-center text-2xl font-semibold pb-3 border-solid">Gallery</h3>
        <div className="w-52 h-1 bg-black" style={{ borderColor: '#CCA43A' }} />
      </div>
    </div>
  );
};

export default Gallery;
